import React, { Component } from 'react';
import './App.css';
import './components/Sound/Sound';
import './components/Timer/Timer';
import './components/TimerControllers';
class App extends Component {
  render() {
    return (
      <div className="App">
      <h1>Can's Pomodoro Timer</h1>

      </div>
    );
  }
}

export default App;
